import $ from 'jquery';
import React from 'react';
import { Component } from 'react';


class RORCalc extends Component {
	constructor() {
    super()
    /* ======================================================
       =========== AVERAGE VS ACTUAL ROR CALC JS ============
       ====================================================== */

       // +++++++++++++++++++++++ //
       // ++ Global Variables  ++ //
       // +++++++++++++++++++++++ //

       let annPay,
           mngFee,
           intRate,
           numYears,
           myCalcPVonIR,
           actROR,
           BOY,
           IL,
           ILPC,
           ILVal,
           startYear = 1963,
           checkedUsePortfolio,
           checkedStocks,
           checkedBonds,
           checkedTreas,
           percentStocks,
           percentBonds,
           percentTreas,
           loggedInState = false,
           calcName,
           actv,
           theData;

      // ===================== THE CALCULATOR CORE VARIABLES ===============================
      let EconData = new Array(),
          stBOY,
          stAnnPay,
          bnAnnPay,
          bnBOY,
          trAnnPay,
          trBOY,
          RORTableArray = new Array(),
          BOYBalance = new Array(),
      	  EOYBalance = new Array(),
          newBalance,
          tyrs = 1,
          recalcFlag = false;

    //const mathfuncts = new MathFuncts();
    //const recalcvalues = new reCalcValues();
    //const dispcomp = new displayComposite();
}

  jQuery() {
    	// +++++++++++++++++++++++++++ //
    	// +++ Data/Ajax Functions +++ //
    	// +++++++++++++++++++++++++++ //
    	// uses REST API http://localhost:5000/all
    	$.get("http://18.188.124.75:5000/all", function(res) {
    		EconData = JSON.parse(res);
    	});
  }

  componentDidMount() {
    this.jQuery()
  }

  render() {
    return(
      document.write(this.EconData)
    );
  }
}

export default RORCalc;
